plot

Jackass 3.5 is a 2011 sequel to Jackass 3D, composed of unused footage shot during the filming of Jackass 3D and interviews from cast and crew (similar to Jackass 2.5).[31] The entire movie started to be streamed in weekly segments on Joost, starting April Fools' Day, April 1st, 2011. Previously the first trailer was released online on January 27, 2011 and the feature-length movie will be released on Blu-Ray and DVD on June 14th, 2011

